        _vm._v(
          "As there is  an analogy  between the Jewish holy  place, and the Christian  house  of  God;  so  there  is  an  analogy  between  the furniture  of  the  first  tabernacle  or  holy  place,  and  those  who officiated in it; and the furniture of the Christian house of God, and those who officiate in it. 'In the first tabernacle, said Paul, which is called  "
        ),
