          "  there  were  the  candlestick,  and  the  table,  and  the showbread,'  or  the  loaves  of  the  presence.  On  the  golden  table every  Sabbath  day  were  placed  "
        ),
        _c("em", [_vm._v("twelve")]),
        _vm._v(
          "  loaves,  which  were exhibited there for one week, and on the next Sabbath they were substituted  by  twelve  fresh  loaves  sprinkled  over  with frankincense. The loaves which were removed from the table, were eaten by the priests. These were called in the Hebrew, 'the loaves of the faces,' or the loaves of the presence. This emblem of the abundance of spiritual food in the presence of God for all who dwell  in  the  holy  place,  stood  always  upon  the  golden  table furnished by the twelve tribes, even in the wilderness. The light in the first tabernacle was not from "
        ),
